import React from 'react'

const MultiView = () => {
    return(
        <div className={multiview_style}>
            <h1>Style</h1>
        </div>
    );
}

const multiview_style = {
    width: "80%",
    height: "65%",
    marginLeft: "50px",
    marginTop: "50px",
    backgroundColor: "black",
    position: "fixed",
    zIndex: "2"
}
export default MultiView
